import React, { useState, useEffect } from 'react';
import { google } from 'googleapis';


function Ensalamento() {
  const [professor, setProfessor] = useState('');
  const [desafio, setDesafio] = useState('');
  const [periodo, setPeriodo] = useState('');
  const [curso, setCurso] = useState('');
  const [horario, setHorario] = useState('');
  const [data, setData] = useState('');
  const [horaInicial, setHoraInicial] = useState('');
  const [horaFinal, setHoraFinal] = useState('');
  const [sala, setSala] = useState('');
  const [ensalamentos, setEnsalamentos] = useState([]);

  const adicionarEnsalamento = () => {
    if (
      professor &&
      desafio &&
      periodo &&
      curso &&
      horario &&
      data &&
      horaInicial &&
      horaFinal &&
      sala
    ) {
      const ensalamento = {
        id: new Date().getTime(),
        professor: professor,
        desafio: desafio,
        periodo: periodo,
        curso: curso,
        horario: horario,
        data: data,
        horaInicial: horaInicial,
        horaFinal: horaFinal,
        sala: sala,
      };

      const ensalamentosAtualizados = [...ensalamentos, ensalamento];
      setEnsalamentos(ensalamentosAtualizados);

      setProfessor('');
      setDesafio('');
      setPeriodo('');
      setCurso('');
      setHorario('');
      setData('');
      setHoraInicial('');
      setHoraFinal('');
      setSala('');
    }
  };

  const excluirEnsalamento = (id) => {
    const ensalamentosFiltrados = ensalamentos.filter(
      (ensalamento) => ensalamento.id !== id
    );
    setEnsalamentos(ensalamentosFiltrados);
  };

  return (
    <div>
      <div className="form-container">
        <h2>Selecione o Professor</h2>
        <select
        className='home-container'  
          id="nomeSelectProfessor"
          placeholder="Nome"
          value={professor}
          onChange={(e) => setProfessor(e.target.value)}
        >
        </select>
        <h2>Cadastro de Período</h2>
        <select
        className='home-container'  
          id="nomeSelectPeriodo"
          placeholder="Nome"
          value={professor}
          onChange={(e) => setPeriodo(e.target.value)}
        >
        </select>
        <h2>Cadastro de Salas</h2>
        <select
        className='home-container'  
          id="nomeSelectSalas"
          placeholder="Nome"
          value={professor}
          onChange={(e) => setSala(e.target.value)}
        >
        </select>
        <h2>Cadastro de Matérias</h2>
        <select
        className='home-container'  
          id="nomeSelectDesafio"
          placeholder="Nome"
          value={professor}
          onChange={(e) => setDesafio(e.target.value)}
        >
        </select>

       <h2>Hora Inicial: </h2>
        <input
        className='home-container'        
          type="time"
          id="horaInicial"
          placeholder=""
          value={horaInicial}

        />

        <h2>Hora Final: </h2>
        <input
        className='home-container'
          type="time"
          id="horaFinal"
          placeholder=""
          value={horaFinal}

        />


        <div>
          <button onClick={adicionarEnsalamento}>Adicionar</button>
        </div>
      </div>
      <div className="table-container">
        <h2>Ensalamento</h2>
        <table id="tabelaPessoas">
          <thead>
            <tr>
              <th>ID</th>
              <th>Professor</th>
              <th>Desafio</th>
              <th>Periodo</th>
              <th>Curso</th>
              <th>Horário</th>
              <th>Data - Tempo</th>
              <th>Sala</th>
              <th>Ações</th>
            </tr>
          </thead>
          <tbody>
            {ensalamentos.map((ensalamento) => (
              <tr key={ensalamento.id}>
                <td>{ensalamento.id}</td>
                <td>{ensalamento.professor}</td>
                <td>{ensalamento.desafio}</td>
                <td>{ensalamento.periodo}</td>
                <td>{ensalamento.curso}</td>
                <td>{ensalamento.horario}</td>
                <td>
                  {ensalamento.data} - {ensalamento.horaInicial} a{' '}
                  {ensalamento.horaFinal}
                </td>
                <td>{ensalamento.sala}</td>
                <td>
                  <button onClick={() => excluirEnsalamento(ensalamento.id)}>
                    Excluir
                  </button> 
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Ensalamento;
